print(decoded_str)

# Splitting the string into a list of hex values
hex_values = decoded_str.split()

# Mapping for conversion
conversion_map = {
    "60": "0",
    "61": "1",
    "40": " "
}

# Converting each hex value according to the conversion map
converted_values = [conversion_map[val] for val in hex_values]

# Grouping the converted values into 8-bit binary strings
binary_strings = [''.join(converted_values[i:i+8]) for i in range(0, len(converted_values), 9)]
print(binary_strings)

# Converting each binary string to its ASCII character representation
ascii_string = ''.join([chr(int(binary, 2)) for binary in binary_strings])
print("ascii : " + ascii_string)

# Converting the hex string to bytes
bytes_data = bytes.fromhex(ascii_string.replace(" ", ""))
print(bytes_data)

# Decoding the bytes using Base64
decoded_string = base64.b64decode(bytes_data).decode('utf-8')
print(decoded_string)